def frequency_count(arr):
    frequency = {}
    max_frequency = 1
    min_frequency = float('inf')
    for num in arr:
        if num in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
        max_frequency = max(max_frequency, frequency[num])
        min_frequency = min(min_frequency, frequency[num])
    most_frequent = []
    least_frequent = []
    for (num, freq) in frequency.items():
        if freq == max_frequency:
            most_frequent.append(num)
        if freq == min_frequency:
            least_frequent.append(num)
    return {'frequency': frequency, 'most_frequent': most_frequent, 'least_frequent': least_frequent}

